import React from 'react'
import ArtCard from './ArtCard'
import { Grid } from 'semantic-ui-react'

function ArtPage(
    { 
        currentUser, 
        artworks, 
        onAcquireArtwork, 
    }
) {

  const artworkCard =
    artworks.map((artwork) => {
        return <ArtCard 
            key={artwork.id} 
            artwork={artwork} 
            currentUser={currentUser} 
            onAcquireArtwork={onAcquireArtwork}/>
    })

    return(
        <Grid padded>
            <Grid.Row>
            {artworkCard}
            </Grid.Row>
        </Grid>
    )
}

export default ArtPage;

